 Alien Skin Exposure 5.0.0.696 (Photoshop plugin)

 Enjoy all the creative tools of film photography, such as discontinued films, dark room tricks, and lo-fi camera quirks. We accurately simulate classic films, like Kodachrome, Polaroid, and Panatomic-X. The result is a photo that looks like it was made by a human, not a computer. 

 There is careful research under the hood, but we keep the controls simple so you can focus on your art. Exposure 5 has a completely redesigned user interface that helps you quickly develop your own look. Across the board everything is faster and much easier to use.

 - Disconnet net
 - Install
 - Copy Crack to destination folder (for example: Program Files/ Alien Skin/Exposure 5 
 - Run Ps, open image, go to plugin, run keygen, select Exposure 4 and activate soft (E-mail activation)

 NOTE: The Key Generator DOES NOT have an option for Exposure 5, but the Exposure 4 option WILL WORK.
